import React from 'react';
import HomePage from '../Home/HomePage';
import { useNavigate } from 'react-router-dom';

function Firstpage() {
    const navigate = useNavigate();

  const handleClick = () => {
    navigate('/Home');  // Adjust the path as needed
  };
  const handle = () => {
    navigate('/Login'); 
  }
  const hand = () => {
    navigate('/Register'); 
  }
  return (
    <div>
    <div>
    <section className="menu">
        <div className="nav">
            <div className="logo"><h1>MJ<b>EATS</b></h1></div>
            <ul>
                <li><a className="active" href="#">Home</a></li>
                
                <li><a href="#">About Us</a></li>
            </ul>
            <div>
                <input onClick={handle} className="signin" type="submit" value="Sign In" name="signin"/>
                <input onClick={hand} className="signup" type="submit" value="Sign Up" name="signup"/>
            </div>
        </div>
    </section>
    <section className="grid">
        <div className="content">
            <div className="content-left">
                <div className="info">
                    <h2>Order Your <br/>Food Anytime</h2>
                    <p>Hey,Our delicious food is waiting for you,<br/>We are always near to you with fresh item of food</p>
                </div>
                <button onClick={handleClick}>Explore Food</button>
            </div>
            <div className="content-right">
                <img src="momo.jpeg" alt=""/>
            </div>
        </div>
    </section>
    <section className="category"/>
        <div className="list-items">
            
        </div>
    
                
</div>

    </div>
  );
}

export default Firstpage;
